import styles from "../assets/Shows.module.css";
import commonStyles from "../assets/common.module.css";

function SpecificShow(details) {
  return (
    <div className={commonStyles.specificElement}>
      <h2 className={styles.month}>{details.month}</h2>
      <div className={styles.showInfo}>
        <h2 className={styles.showDay}>{details.day}</h2>
        <div className={styles.concretInfo}>
          <h3>{details.city}</h3>
          <h4>{details.place}</h4>
          <h4>{details.price}</h4>
          <a href={details.ticketsLink} target="_blank" rel="noreferrer">
            Comprar entrades
          </a>
        </div>
      </div>
    </div>
  );
}

export default SpecificShow;
